import { __decorate, __param } from "tslib";
import { Component, Inject } from '@angular/core';
import { MAT_DIALOG_DATA } from '@angular/material/dialog';
let DeleteCourseDialogComponent = class DeleteCourseDialogComponent {
    constructor(dialogRef, courseId, coursesService, snackBar) {
        this.dialogRef = dialogRef;
        this.courseId = courseId;
        this.coursesService = coursesService;
        this.snackBar = snackBar;
    }
    async deleteCourse() {
        var result = await this.coursesService.deleteCourse(this.courseId);
        if (result) {
            this.snackBar.open('Poprawnie usunięto kurs', 'Zamknij');
            this.dialogRef.close(true);
        }
        else {
            this.snackBar.open('Usuwanie kursu się nie powiodło, wystąpił bład po stronie serwera', 'Zamknij');
        }
    }
    closeDialog() {
        this.dialogRef.close();
    }
};
